import React from "react";

const Info = (users) => {
  console.log(users);

  return (
    <div className="info-card">
      <ul>-name: {users['name']}</ul>
      <ul>-username: {users['username']}</ul>
      <ul>-email: {users['email']}</ul>
      <ul>-phone: {users['phone']}</ul>
      <ul>-company: {users['company']['name']}</ul>
      <ul>-website: {users['website']}</ul>
      <ul>
        -address:
        <li>street: {users['address']['street']}</li>
        <li>suite: {users['address']['suite']}</li>
        <li>city: {users['address']['city']}</li>
        <li>zipcode: {users['address']['zipcode']}</li>
      </ul>
    </div>
  );
};

export default Info;
